import React from "react";
import { NavLink } from "react-router-dom";

function MoviePage() {
  return (
    <div>
      <h1>Movie</h1>
      <p>This is the movie page</p>
      <NavLink to="/">Landing</NavLink>
    </div>
  );
}

export default MoviePage;
